import React from 'react';
import './Navigation.scss';

const Navigation = () => {

    return (
        <div className="navigation">
            <ul>
                <li>Home</li>
                <li>Data Structures</li>
                <li>Algorithms</li>
            </ul>
        </div>
    );
}

export default Navigation
